eño de desconectarme del día a las p. m. y dormir a las p. m. Ahora amo todos los aspectos de este ritual y con él en su lugar me despierto a las am sintiéndome fresco.  El poder con tus mañanas es que tendrás alrededor de 000 de ellas en tu vida, así que hay mucho espacio para experimentar.  Ejercicio diario  "Descubrimos que las personas que son más activas físicamente tienen sentimientos activados más placenteros que las personas que son menos activas" - Amanda Hyde  En los últimos tres años, pasé de jugar con el ejercicio a convertirlo en algo que hago cada día laborable sin falta. Al principio no tenía idea de qué hacer en el gimnasio, así que le pregunté a mi hermano, que es entrenador personal. Luego fui varias veces con un buen amigo y pronto me enganché.   Con el tiempo, desarrollé esto en un ritual diario tan fuerte que siento una atracción hacia él, y al hacerlo constantemente me siento fantástico y puedo tomar más fácilmente en otros retos. Recientemente descubrí que el ejercicio es un hábito clave que allana el camino para el crecimiento en todas las demás áreas. También descubrí que me ayuda a tener un sueño de alta calidad cada noche.   Tener el hábito de la desconexión  "Las vidas más ricas, felices y productivas se caracterizan por la capacidad de participar plenamente en el desafío que se presenta, pero también desconectarme periódicamente y buscar la renovación" - Loehr y Schwarz, The Power of Full Engagement  Como mencioné anteriormente, una forma clave en la que puedo despertarme a las a.m. es a través de mi ritual de desconexión por la noche. Salgo a caminar a las de la noche, por una ruta que ya he hecho muchas veces. Como la ruta ya está decidida y es la misma cada vez, simplemente camino y no hago nada más. Esto invita a la reflexión y la relajación."}

