7. {"Username":"Alberico", "pronoun":"ella", "message":"Este es el segundo ensayo de una serie de dos partes sobre mi viaje para visitar el Taj Mahal. Lea la primera parte para conocer la historia completa.    A  GRA, Uttar Pradesh, India a Tan pronto como mi tren a Agra sale de Delhi, me encuentro confundido nuevamente. Estoy acostado en mi litera superior reservada, aunque la mayoría de las camas de los vagones del tren no se están utilizando y casi todos los pasajeros están sentados en los asientos inferiores. Me siento ridículo, como el emperador de mi vagón de tren, supervisando al resto de los pasajeros desde arriba. Mientras tanto, los hombres pasan debajo de mí y me ofrecen un misterioso curry vegetariano en cubos de tamaño industrial. Le hago señas a uno para que me sirva un poco en un plato de papel, pero cuando trato de pagar la comida, no acepta dinero. Esta es la primera vez que obtengo algo gratis en la India. Concluyo que la comida me va a matar.    Mientras como, el tren hace una parada y los pasajeros bajan, pero el conductor no hace ningún anuncio. No puedo ver a través de ninguna de las diminutas ventanas inferiores del tren desde mi litera superior. No tengo idea de dónde estoy.    ¿Es esto Agra?a le pregunto a un hombre sentado debajo de mí. Pregunto tan amablemente como puedo, en un intento de evitar parecer un farisaico emperador vagón de tren, gritando preguntas a mis siervos. Después de todo, recuerdo que el constructor del Taj Mahal y emperador mogol Shah Jahan fue derrocado por su hijo poco después de la finalización del Taj Mahalas. El hombre de abajo niega con la cabeza y, en hindi, creo que me dice que todavía nos queda un largo viaje hasta Agra. Otro hombre pasa vendiendo comida no vegetariana en latas de aluminio. Ya se han disparado los primeros tiros de una guerra intestinal a raíz de mi cubo de comida gratis, así que declino. A medida que el tren avanza hacia Agra, deteniéndose en las estaciones a lo largo del camino, me encuentro continuamente reclutando nuevos siervos debajo de mí para saber dónde estamos. Para cuando estoy a la mitad del viaje, tengo un niño de dieciocho años, dos soldados indios y una mujer joven, ninguno de los cuales habla inglés, tratando de ayudarme. Es fácil agregar accidentalmente ayudantes en el tren; afortunadamente, los indios tienden a ser especialmente protectores con los occidentales despistados que intentan entender el transporte público indio. En un momento, los dos soldados indios exigen que un adolescente mueva los pies apoyados en mi litera, y la joven hace recomendaciones de comida mientras pasan baldes. Son como cuatro Hadas Madrinas del Tren. Pronto, me quedo dormido.    De repente, me despierto con el sonido de cuatro indios cantando aAgra! Agra!a al unísono. Termino abruptamente mi tiempo como emperador del vagón de tren, salto de mi cama, les agradezco a los cuatro y tomo un taxi a mi casa de huéspedes en Agra. Antes de que se vaya, hago los arreglos para que mi taxista me recoja a las am de la mañana siguiente para llevarme al Taj Mahal.    Por la mañana, le digo a mi taxista que me lleve a la puerta este del Taj Mahal. Rápidamente me lleva a una rotonda cerca de la Puerta Oeste en lugar de a su Puerta Este. Un anuncio sobre nuestra llegada es bastante convincente. Los taxistas perpetuamente deshonestos de la India siempre tienen motivos ocultos (ya veces misteriosos); en este caso, estaba tratando de ahorrar gasolina llevándome a la Puerta más cercana a mi hotel y, según Lonely Planet, posiblemente cobrar un soborno de los conductores de camellos y rickshaw sentados cerca de la Puerta Oeste esperando para llevar a los turistas a la taquilla de Tajas. . No me molesto en discutir con él ya que no queda mucho tiempo hasta el amanecer, y camino rápidamente hacia la entrada. Haciendo fila con otros veinte turistas, en su mayoría indios, me sorprende ver la falta de occidentales e imaginé que todos los blancos de la India irían en masa al Taj Mahal.    Finalmente, las puertas se abren y puedo ver por primera vez del edificio considerado como el más hermoso del mundo, uno cuyo creador se jactaba de haber hecho que el sol y la luna derramaran lágrimas de sus ojos. Veo la famosa cúpula de mármol blanco asomándose a través del arco de la Gran Puerta como turistas sostenga las cámaras por encima de sus cabezas para obtener su primera instantánea. Camino deliberadamente hacia y alrededor del Taj, empapándome del amanecer, tomando fotos lentamente desde todos los ángulos posibles. Un puñado de fotógrafos se reúnen conmigo frente a la mezquita adyacente Taj Mahal para capturar el sol a medida que sale detrás de ella. Todos son reverentes, teniendo cuidado de no interferir con las fotografías de los demás y ofreciéndose a ayudar a tomar fotografías posadas. El momento es perfecto para el grupo de fotógrafos: la niebla cubre el río Yamuna detrás de la estructura, y el edificio parece haber surgido espontáneamente de un cielo nublado, una manifestación concreta del nirvana.    La simple presencia del Taj, construido como un símbolo del amor eterno del emperador Jahan en memoria de su tercera esposa que murió durante el parto, parece animar incluso a los fotógrafos rabiosos a cooperar entre sí. caligrafía en el arco de entrada, mirando los minaretes y tocando las intrincadas pantallas de celosía en el interior del mausoleo. Estoy a punto de terminar, tomando algunas fotografías clásicas finales del estanque de reflexión del Taj Mahal desde el exterior, cuando una bella mujer rubia joven que realiza poses juguetonas y provocativas para la cámara de sus amigos me llama la atención. Pronto, una hilera de hombres indios, y también algunas familias indias, empiezan a interrumpirla para pedirle que pose con ellos en fotos de recuerdo.    aLos turistas indios parecen más interesados en tu piel blanca y cabello rubio que en el mármol blanco del Taj Mahal. ,a le digo. Estoy bastante seguro de que muchos de estos muchachos indios se van con más fotos tuyas que el Taj.a    Ella se ríe y se presenta como Sophie, de Francia, y, rápidamente, estamos intercambiando historias divertidas de nuestros viajes por la India. Nos gustamos inmediatamente. Nos encontramos charlando frente al estanque de reflexión de Tajas durante aproximadamente media hora mientras los hombres indios nos miran boquiabiertos. Pero cuando Sophie y yo nos damos cuenta de que nos dirigimos en direcciones opuestas, ella hacia Amritsar en el norte de la India y yo hacia Kerala en el sur de la India, compartimos un momento incómodo durante el cual nos damos cuenta de que este es el único encuentro de toda nuestra vida.    bueno, realmente ha sido un placer, Hank, dice ella. Sus ojos se posan en los míos. Por un largo momento, ella no aparta la mirada. No sé si me está mirando a mí o al exquisito reflejo del Taj Mahal en la piscina detrás de mí.     Ella pasa junto a mí, frente al sol naciente. Luego, ella me mira por última vez, sonríe y luego cambia su mirada, una vez más, hacia el símbolo de amor eterno más hermoso del mundo."}
